-- CREATE TABLES --

CREATE TABLE accounts (
    id number(10) NOT NULL,
    email varchar2(255) NOT NULL,
    password varchar2(255) NOT NULL,
    first_name varchar2(100) NOT NULL,
    last_name varchar2(100) NOT NULL,
    phone_number number(10) NOT NULL,
    role number(3) DEFAULT '0' NOT NULL,
    PRIMARY KEY (id)
);

CREATE TABLE products (
    id number(10) NOT NULL,
    name varchar2(255) NOT NULL,
    description clob NOT NULL,
    price number(7, 2) NOT NULL,
    quantity number(10) NOT NULL,
    img clob NOT NULL,
    date_added timestamp(0) DEFAULT SYSTIMESTAMP NOT NULL,
    discount_id number(10) DEFAULT '0' NOT NULL,
    availability number(1) DEFAULT '1' NOT NULL,
    PRIMARY KEY (id)
);

alter table products modify discount_id default '1';

CREATE TABLE discounts (
    id number(10) NOT NULL,
    discount_code varchar2(50) NOT NULL,
    discount_value number(7, 2) NOT NULL,
    start_date timestamp(0) NOT NULL,
    end_date timestamp(0) NOT NULL,
    PRIMARY KEY (id)
);

CREATE TABLE shipping_type (
    id number(10) NOT NULL,
    name varchar2(255) NOT NULL,
    price number(7, 2) NOT NULL,
    PRIMARY KEY (id)
);

CREATE TABLE transactions (
    id number(10) NOT NULL,
    account_id number(10) DEFAULT NULL,
    transaction_id varchar2(255) NOT NULL,
    payment_amount number(7, 2) NOT NULL,
    shipping_type number(2) NOT NULL,
    payment_status varchar2(25) NOT NULL,
    creation_date timestamp(0) DEFAULT SYSTIMESTAMP NOT NULL,
    payer_email varchar2(255) DEFAULT '' NOT NULL,
    first_name varchar2(100) DEFAULT '' NOT NULL,
    last_name varchar2(100) DEFAULT '' NOT NULL,
    address_country varchar2(100) DEFAULT '' NOT NULL,
    address_county varchar2(100) DEFAULT '' NOT NULL,
    address_city varchar2(100) DEFAULT '' NOT NULL,
    address_street varchar2(255) DEFAULT '' NOT NULL,
    address_zip varchar2(50) DEFAULT '' NOT NULL,
    payment_method varchar2(50) DEFAULT 'website' NOT NULL,
    PRIMARY KEY (id)
);

CREATE TABLE transactions_items (
    id number(10) NOT NULL,
    transaction_id varchar2(255) NOT NULL,
    item_id number(10) NOT NULL,
    item_price number(7, 2) NOT NULL,
    item_quantity number(10) NOT NULL,
    item_shipping_price number(7, 2) NOT NULL,
    PRIMARY KEY (id)
);

CREATE TABLE brands (
    id number(10) NOT NULL,
    name varchar2(255) NOT NULL,
    PRIMARY KEY (id)
);

CREATE TABLE products_brands (
    id number(10) NOT NULL,
    product_id number(10) NOT NULL,
    brand_id number(10) NOT NULL,
    PRIMARY KEY (id)
);

CREATE TABLE products_images (
    id number(10) NOT NULL,
    product_id number(10) NOT NULL,
    img varchar2(255) NOT NULL,
    PRIMARY KEY (id)
);

CREATE TABLE review (
    id number(10) NOT NULL,
    product_id number(10) NOT NULL,
    first_name varchar2(100),
    last_name varchar2(100),
    message clob NOT NULL,
    rating number(2) NOT NULL,
    review_date timestamp(0) DEFAULT SYSTIMESTAMP NOT NULL,
    PRIMARY KEY (id)
);

CREATE TABLE components (
  id number(10) NOT NULL,
  product_id number(10) NOT NULL,
  processor_id number(10) NOT NULL,
  gpu_id number(10) NOT NULL,
  ram_id number(10) NOT NULL,
  storage_id number(10) NOT NULL,
  PRIMARY KEY (id)
);

CREATE TABLE processor (
    id number(10) NOT NULL,
    name varchar2(100) NOT NULL,
    PRIMARY KEY (id)
);

CREATE TABLE gpu (
    id number(10) NOT NULL,
    name varchar2(100) NOT NULL,
    PRIMARY KEY (id)
);

CREATE TABLE ram (
    id number(10) NOT NULL,
    name varchar2(100) NOT NULL,
    PRIMARY KEY (id)
);

CREATE TABLE storage (
    id number(10) NOT NULL,
    name varchar2(100) NOT NULL,
    PRIMARY KEY (id)
);

ALTER TABLE products ADD CONSTRAINT prod_fk_discounts FOREIGN KEY (discount_id) REFERENCES discounts(id);
ALTER TABLE products_brands ADD CONSTRAINT pb_fk_products FOREIGN KEY (product_id) REFERENCES products(id);
ALTER TABLE products_brands ADD CONSTRAINT pb_fk_brands FOREIGN KEY (brand_id) REFERENCES brands(id);
ALTER TABLE products_images ADD CONSTRAINT pi_fk_products FOREIGN KEY (product_id) REFERENCES products(id);
ALTER TABLE components ADD CONSTRAINT c_fk_products FOREIGN KEY (product_id) REFERENCES products(id);
ALTER TABLE components ADD CONSTRAINT c_fk_cpu FOREIGN KEY (gpu_id) REFERENCES gpu(id);
ALTER TABLE components ADD CONSTRAINT c_fk_processor FOREIGN KEY (processor_id) REFERENCES processor(id);
ALTER TABLE components ADD CONSTRAINT c_fk_ram FOREIGN KEY (ram_id) REFERENCES ram(id);
ALTER TABLE components ADD CONSTRAINT c_fk_storage FOREIGN KEY (storage_id) REFERENCES storage(id);

ALTER TABLE transactions ADD CONSTRAINT tr_uk UNIQUE (transaction_id);
ALTER TABLE transactions_items ADD CONSTRAINT tr_it_uk UNIQUE (transaction_id);
ALTER TABLE transactions ADD CONSTRAINT t_fk_transaction_items FOREIGN KEY (transaction_id) REFERENCES transactions_items(transaction_id);

ALTER TABLE transactions ADD CONSTRAINT t_fk_accounts FOREIGN KEY (account_id) REFERENCES accounts(id);
ALTER TABLE transactions ADD CONSTRAINT t_fk_shipping_type FOREIGN KEY (shipping_type) REFERENCES shipping_type(id);
ALTER TABLE review ADD CONSTRAINT r_fk_products FOREIGN KEY (product_id) REFERENCES products(id);


